/**
 * 可以理解为异步执行
 * requestIdleCallback 是浏览器空闲时会自动执行内部函数
 * requestAnimationFrame 是浏览器必须执行的
 * 关于 requestIdleCallback 和  requestAnimationFrame 可以参考 https://www.cnblogs.com/cangqinglang/p/13877078.html
 */
const nextTime = window.requestIdleCallback ||
    window.requestAnimationFrame ||
    ((callback) => setTimeout(callback, 17));
function onAfterLoad(callback) {
    if (document.readyState === 'complete') {
        setTimeout(callback);
    }
    else {
        window.addEventListener('pageshow', callback, { once: true, capture: true });
    }
}

let caches = [];
const max = 5;
const baseInfo = {
    baseUrl: '',
    appId: '',
    userId: ''
};
let timer = undefined;
const report = function (data, immediate = false) {
    if (immediate) {
        // 立即上传
        sendBeacon(baseInfo.baseUrl, {
            baseInfo,
            eventInfo: [data],
        });
        return;
    }
    caches.push(data);
    clearTimeout(timer);
    if (caches.length >= max) {
        send();
    }
    else {
        timer = window.setTimeout(send, 5000);
    }
};
const send = function () {
    if (caches.length) {
        const sendEvents = caches.slice(0, max);
        caches = caches.slice(max);
        const sendTime = Date.now();
        sendBeacon(baseInfo.baseUrl, {
            ...baseInfo,
            sendTime,
            data: sendEvents.map((event) => event),
        });
        if (caches.length) {
            nextTime(send);
        }
    }
};
